import './App.css';

function App() {
    return (
        <div className="App"> 
            <header className='header'>
                <img src="" alt="Лого" />
                <ul className='nav-links'>
                    <li>ГЛАВНОЕ</li>
                    <li>ИНФОРМАЦИЯ</li>
                    <li>О НАС</li>
                </ul>
            </header>
        </div>
    );
}

export default App;
